import React from 'react';

function Home() {
  return (
    <div className='home'>
      <h1 className='home-h1'>Welcome to Full Stack MERN Project</h1>
      
      <img src="/img/full_stack__1_-removebg-preview.png" alt="img-mern" />
    </div>
  );
}

export default Home;
